// App.js
import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';  // Import Routes, Route, dan Link
import Home from './Home';
import About from './About';

function App() {
  return (
    <div>
      <nav className="p-6 bg-teal-700">
        <ul className="flex space-x-6">
          <li><Link to="/" className="text-white">Home</Link></li>
          <li><Link to="/about" className="text-white">About</Link></li>
        </ul>
      </nav>

      <div className="p-6">
        <Routes>
          <Route path="/" element={<Home />} />  {/* Definisikan rute ke Home */}
          <Route path="/about" element={<About />} />  {/* Definisikan rute ke About */}
        </Routes>
      </div>
    </div>
  );
}

export default App;
